    return(
       <div className={styles.novaConta_container}>
            <h1>Cadastrar Conta</h1>
            <p>cadastre suas contas para melhor controle de suas finanças</p>
            <ProjetoForm btntext='Cadastrar' cadastrar={cadastrar} />
            
       </div>

    )
}

export default Nova_conta
